import React, { Component} from "react";
import { NavLink, Link, BrowserRouter } from 'react-router-dom';
import "./start-page.css";
import back from "../images/new.svg"

class Main extends Component {


    render() {
    return (




        <div className="wraper">
            <h1>Children task</h1>
            <div className="main">
                <div className="status">
                    <div className="create-square"><NavLink className="textalign" to="/create-task"><p>Create</p></NavLink></div>
                    <div className="home-square"><NavLink to="/"><p>Home</p></NavLink></div>
                </div>
                <div className="status">
                    <div className="get-square"><NavLink to="/get-task"><p>Get task</p></NavLink></div>
                    <div className="empty-square"></div>
                </div>
                <div className='img'>
                    <img src={back} alt="back" ></img>
                </div>
            </div>
        </div>
    );
    }
}
export default Main;
